// src/components/Home.js
import React, { useEffect, useState } from 'react';

const technicalSkills = [
  { name: 'HTML5', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/html5/html5-original.svg' },
  { name: 'CSS3', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/css3/css3-original.svg' },
  { name: 'JavaScript', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/javascript/javascript-original.svg' },
  { name: 'Python', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/python/python-original.svg' },
  { name: 'Java', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/java/java-original.svg' },
  { name: 'jQuery', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/jquery/jquery-original.svg' },
  { name: 'ASP.NET', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/dot-net/dot-net-original.svg' },
  { name: 'SQL', img: 'https://cdn-icons-png.flaticon.com/512/2772/2772128.png' },
  { name: 'MySQL', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mysql/mysql-original.svg' },
  { name: 'Oracle', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/oracle/oracle-original.svg' },
  { name: 'WordPress', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/wordpress/wordpress-original.svg' },
  { name: 'Shopify', img: 'https://cdn-icons-png.flaticon.com/512/5968/5968906.png' },
  { name: 'AWS', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/amazonwebservices/amazonwebservices-original-wordmark.svg' },
  { name: 'Azure', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/azure/azure-original.svg' },
  { name: 'GCP', img: '/logo/googlecloud.png' },
  { name: 'Office 365', img: '/logo/office365.jpg' },
  { name: 'Google Charts', img: '/logo/googlecharts.png' },
  { name: 'Draw.io', img: '/logo/drawio.png' }
];

// Professional Development Component with animations & responsiveness
const ProfessionalDevelopment = () => {
  const certificates = [
    { name: 'Professional Year (Oct 2022 â€“ Apr 2023), Performance Education', img: '/logo/pe.png' },
    { name: 'AWS Cloud Practitioner Essentials, AWS Training', img: '/logo/aws.png' },
    { name: 'Google Professional Cloud Developer Certificate', img: '/logo/gcpd.png' },
    { name: 'Business Analysis and Process Management, Coursera', img: '/logo/c.png' },
    { name: 'Marketing Tools: Social Media, LinkedIn Learning', img: '/logo/linkedin.png' },
    { name: 'Software Development Analytics Certification, SAS', img: '/logo/sas.png' },
    { name: 'Web Page Development Certification, Alison', img: '/logo/alison.jpg' },
    { name: 'Database Foundations, LinkedIn Learning', img: '/logo/linkedin.png' },
    { name: 'Salesforce Developer AI Introduction, Alison', img: '/logo/alison.jpg' },
    { name: 'Diploma in HTML5, CSS3, JavaScript and Python, Alison', img: '/logo/alison.jpg' },
  ];

  const [visible, setVisible] = useState(false);

  useEffect(() => {
    const timeout = setTimeout(() => setVisible(true), 100);
    return () => clearTimeout(timeout);
  }, []);

  return (
    <section
      id="professional-development"
      style={{
        padding: '2rem',
        backgroundColor: '#111',
        borderRadius: 8,
        color: '#eee',
        marginBottom: '2rem',
      }}
    >
      <h2 style={{ fontSize: '2.25rem', marginBottom: '2rem' }}>Professional Development</h2>
      <div
        style={{
          display: 'flex',
          flexWrap: 'wrap',
          gap: '2rem',
          justifyContent: 'flex-start',
        }}
      >
        {certificates.map((cert, i) => (
          <div
            key={cert.name}
            style={{
              backgroundColor: '#222',
              borderRadius: 12,
              boxShadow: '0 6px 16px rgba(0,0,0,0.75)',
              padding: '1.5rem 2rem',
              width: '100%',
              maxWidth: 380,
              display: 'flex',
              alignItems: 'center',
              gap: '1.5rem',
              cursor: 'default',
              transition:
                'transform 0.3s ease, box-shadow 0.3s ease, opacity 0.6s ease, transform 0.6s ease',
              opacity: visible ? 1 : 0,
              transform: visible ? 'translateY(0)' : 'translateY(20px)',
              transitionDelay: `${i * 100}ms`,
            }}
            onMouseEnter={(e) => {
              e.currentTarget.style.transform = 'scale(1.07)';
              e.currentTarget.style.boxShadow = '0 10px 30px rgba(0,0,0,0.95)';
            }}
            onMouseLeave={(e) => {
              e.currentTarget.style.transform = 'translateY(0) scale(1)';
              e.currentTarget.style.boxShadow = '0 6px 16px rgba(0,0,0,0.75)';
            }}
          >
            <img
              src={cert.img}
              alt={cert.name}
              style={{
                height: 70,
                width: 70,
                objectFit: 'contain',
                borderRadius: 8,
                boxShadow: '0 0 12px rgba(255,255,255,0.15)',
                flexShrink: 0,
              }}
            />
            <p
              style={{
                color: '#eee',
                fontSize: '1.1rem',
                margin: 0,
                fontWeight: 600,
                lineHeight: 1.3,
                flex: 1,
              }}
            >
              {cert.name}
